const Event = () => {
    let [name, setName] = useState('Click Me');
    let prple = "#8e44ad";
    let[Change, bgUpdate] =  useState(prple);
    const bgChange = () =>{
         console.log('clicked');
         setName('Ouch ðŸ˜„')
         prple = '#34495e';
        bgUpdate(prple);
         
    }

    const bgBack = () =>{
        bgUpdate('#8e44ad');
        setName('Ayyo!! ðŸ˜ ')
    }
    return (
        <>
            <div style={{backgroundColor :  Change}}>

                <button onKeyDown={bgChange} onDoubleClick={bgBack}>{name}</button>

            </div>
        </>

    )
}

export default Event;
